import React from 'react'
import { }from 'react-router-dom'

function Navbar() {
    return (
      <div style={{height: '90px', backgroundColor: 'blue'}}>
        <Link>
          <img
            src='https://static.wikia.nocookie.net/wiki-de-rick-morty/images/6/60/Rick_and_Morty.png/revision/latest?cb=20210623034924&path-prefix=es'
            alt='rick and morty logo image'
          />
        </Link>
      </div>
    );
}

export default Navbar
